import React from 'react';
import { NavLink } from 'react-router-dom';
import styled from "styled-components";
import hk from './hk.jpg';
import github from './github.svg';
import linkedin from './linkedin.svg';


export const App = () => {
  return (
    <Background>
              <Container>

        <Navigation>
          <MenuLink href="#home">
            <h3>Home</h3>
          </MenuLink>
          <MenuLink href="#about">          
            <h3>About</h3>
          </MenuLink>        
          <MenuLink href="#services">
            <h3>Services</h3>
          </MenuLink>
          <MenuLink href="#portfolio"> 
            <h3>Portfolio</h3>
          </MenuLink>          
          <MenuLink href="#contact">
            <h3>Contact</h3>
          </MenuLink>
        </Navigation>

<FrontPage id="home">
<h1>JOSEPHINE LAM</h1>
<h3>Developer Freelancer</h3>   
<Icon class="social-link" href="https://www.linkedin.com/in/josephine-lam-180197198/" target="_blank">
              <img class=" icon" src={linkedin} alt="linkedin-logo"></img>
            </Icon>
<a class="social-link" href="https://github.com/prosperpine" target="_blank">
              <img class=" icon" src={github} alt="github-logo"></img>

              </a>
</FrontPage>
<About id="about">
<h1> Hi there, I'm Soliman Doe</h1>
</About>
<Services id="services">
<h1>This is what I do</h1>
<ServiceSection>

<ServiceCard>
  <h2>First example</h2>
</ServiceCard>
<ServiceCard>
  <h2>Second example</h2>
</ServiceCard>
<ServiceCard>
  <h2>Third example</h2>
</ServiceCard>

</ServiceSection>

</Services>
<Portfolio id="portfolio">
<h1>This is what I've done</h1>

</Portfolio>
<Contact id="contact">
<h1>How to contact me</h1>
</Contact>
      </Container>
    </Background>
  )
}


const Background = styled.main`
background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.4)), url(${hk});
background-position: center;
background-repeat: no-repeat;
background-size: cover;
background-attachment: fixed;
height: 100%; 
width: 100%; 
`

const Container = styled.div`
`
const Navigation = styled.div`
background-color: rgba(0, 0, 0, 0.4);
display: flex; 
justify-content: flex-end; 
position: fixed;
top: 0; 
width: 100%; 
`
const MenuLink = styled.a`
padding-right: 14px; 
font-family: 'Nunito', sans-serif;
`


const FrontPage = styled.div`
display: flex; 
flex-direction: column; 
justify-content: center; 
align-items: center; 
height: 100vh; 
font-family: 'Montserrat', sans-serif;

` 

const Icon=styled.a`
border: 1px solid white; 
`


const About = styled.div`
height: 100vh; 
border: 1px solid white; 
background-color: rgba(0, 0, 0, 0.4);




`

const Services = styled.div`
height: 100vh; 
border: 1px solid white; 
display: flex; 
flex-direction: column;
justify-content: center; 
align-items: center;  
`

const ServiceSection =styled.div`
display: flex;
`

const ServiceCard = styled.div`
background-color: rgba(0, 0, 0, 0.4);
display: flex;
box-sizing: border-box;

margin: 40px; 

`



const Portfolio = styled.div`
height: 100vh; 
background-color: rgba(0, 0, 0, 0.4);

border: 1px solid white; 



`

const Contact = styled.div`
height: 100vh; 

border: 1px solid white; 



`
